import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const Layout = () => {
  return (
    <Navbar fixed="top" expand="md">
      <Navbar.Brand href="/">OJOS</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <NavDropdown title="Shop">
            <Navbar expand="md">
              <Nav className="mr-auto">
                <Nav.Link href="/collections/new">New</Nav.Link>
                <Nav.Link href="#link">Tops</Nav.Link>
                <Nav.Link href="#link">Bottoms</Nav.Link>
                <Nav.Link href="#link">Accessories</Nav.Link>
                <Nav.Link href="#link">Bags</Nav.Link>
                <Nav.Link href="#link">Jewelry</Nav.Link>
              </Nav>
            </Navbar>
          </NavDropdown>
          <Nav.Link href="/about">About</Nav.Link>
        </Nav>
      </Navbar.Collapse>
      <Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-success">Search</Button>
        </Form>
        <Nav.Link href="/cart">Cart</Nav.Link>
      </Nav>
    </Navbar>
  );
};

export default Layout;
